import React from "react";
import './nav.scss'
import {
    Link, NavLink
} from "react-router-dom";

class Menu extends React.Component {
    render() {
        return (
            <>
                <div>Hello navigation</div>
                <div class="topnav">
                    <Link to="/about">About</Link>
                    <Link to="/about">About</Link>
                    <Link to="/about">About</Link>
                    <a class="active" href="/">Home</a>
                    <a href="/Todo">Todo</a>
                    <a href="/about">About</a>
                </div>
            </>
        )
    }
}

export default Menu
